import React from 'react';
// import UniversityData from './universities.json';
import axios from 'axios';

class UniversityList extends React.Component {
    render() {

        async function UniversityData() {
            const res = await axios.get('/api/university');
            return res;
        }

        return (
            <div>
                {UniversityData().map((postDetail, index) => {
                    return <div>
                        <h1>{postDetail.name}</h1>
                    </div>
                })}
            </div>
        )
    }
}

export default UniversityList;
